// noinspection SpellCheckingInspection

'use client'

import type { AppRouterInstance } from 'next/dist/shared/lib/app-router-context.shared-runtime'
import Link from 'next/link'
import { useEffect, useRef, useState } from 'react'
import toast from 'react-hot-toast'

const iconB64 =
  'data:image/png;base64,'
// 我就要夹带私货！！！
const avatarB64 =
  'data:image/jpeg;base64,'

export default function Navbar(props: {
  userName: string
  router: AppRouterInstance
  snapshotMode: boolean
}) {
  const [dropdownOpen, setDropdownOpen] = useState(false)
  const dropdownRef = useRef<HTMLDivElement>(null)

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen)
  }

  const handleClickOutside = (event: { target: any }) => {
    if (dropdownRef.current && !dropdownRef.current.contains(event.target)) {
      setDropdownOpen(false)
    }
  }

  function handleLogout() {
    localStorage.removeItem('hfs_token')
    toast.success('已退出登录，返回登录页')
    props.router.push('/login')
  }

  useEffect(() => {
    document.addEventListener('mousedown', handleClickOutside)
    return () => {
      document.removeEventListener('mousedown', handleClickOutside)
    }
  }, [])

  return (
    <nav
      data-html2canvas-ignore='true'
      className='flex items-center justify-between rounded-lg border border-gray-200 p-4 shadow-sm'
    >
      {!props.snapshotMode ? (
        <Link href={'/'}>
          <img
            src={iconB64}
            alt='Icon'
            className='h-8 w-28'
          />
        </Link>
      ) : (
        <a href={'/snapshot'}>
          <img
            src={iconB64}
            alt='Icon'
            className='h-8 w-28'
          />
        </a>
      )}
      <div
        className='relative'
        ref={dropdownRef}
      >
        <button
          onClick={toggleDropdown}
          className='flex items-center space-x-2 focus:outline-none'
        >
          <img
            src={avatarB64}
            alt='Avatar'
            className='h-8 w-8 rounded-full'
          />
          <div
            className={
              'flex gap-1 font-black text-black hover:text-gray-900 dark:text-gray-200 hover:dark:text-white'
            }
          >
            {props.userName}
            <div className='flex items-center gap-2'>
              <svg
                xmlns='http://www.w3.org/2000/svg'
                fill='none'
                viewBox='0 0 24 24'
                strokeWidth={2.2}
                stroke='currentColor'
                className='size-[16px]'
              >
                <path
                  strokeLinecap='round'
                  strokeLinejoin='round'
                  d='M19.5 13.5 12 21m0 0-7.5-7.5M12 21V3'
                />
              </svg>
            </div>
          </div>
        </button>
        {dropdownOpen && (
          <div className='absolute right-0 z-20 mt-2 w-48 rounded-md bg-white py-1 shadow-lg'>
            {props.snapshotMode ? (
              <Link
                className='block px-4 py-2 text-gray-800 hover:bg-gray-200'
                href={'/'}
              >
                试卷列表页
              </Link>
            ) : (
              <Link
                className='block px-4 py-2 text-gray-800 hover:bg-gray-200'
                href={'/snapshot'}
              >
                试卷快照页
              </Link>
            )}
            <Link
              className='block px-4 py-2 text-gray-800 hover:bg-gray-200'
              href={'/settings'}
            >
              设置页
            </Link>
            {!props.snapshotMode ? (
              <div
                className='block cursor-pointer px-4 py-2 text-gray-800 hover:bg-gray-200'
                onClick={handleLogout}
              >
                退出登录
              </div>
            ) : null}
          </div>
        )}
      </div>
    </nav>
  )
}
